import Location from '@assets/svg/Location.svg';
import Arrow from '@assets/svg/arrow-left.svg';

const filter = [
    { title: 'مکان خودرو', icon: <Location />, line: true },
    { name: 'استان', arrow: <Arrow /> },
    { name: 'شهر', arrow: <Arrow /> },
];

export default filter;
